import React from "react";

export const ArticleContext = React.createContext();

export const ArticleProvider = (props) => {
  const [articleContext, setarticleContext] = React.useState([]);
  return (
    <ArticleContext.Provider value={[articleContext, setarticleContext]}>
      {props.children}
    </ArticleContext.Provider>
  );
};
